values:
Ever feel like decisions you've made were for reasons that were clearly asinine and inconsequential?&nbsp;
Man, do I ponder the weirdest things at 3am, when I have nothing better do to.&nbsp;

Briefly helped Megan make a plane for our Snake on a Plane Pantomime...it just needs a back and a wing.&nbsp;
I kind of want this entire....uh week to be over, just I can think about something else, besides fucking Pantomime. I haven't had a head ache that throbbed this much since I had Optic-neuritis.&nbsp;

And I kind of feel like the stuff I continue to make up for Pantomime is getting exponentially worse as we practice. Ugh. I'll just be pissed if Time Warp gets the boot.&nbsp;

And yeah there's some other stuff I guess, but I dont' feel like typing, I'm only doing this because I'm bored out of my fucking mind.

K night all&lt;3!

I biked nine miles today...everyone should be proud...because I hate biking. Actually I only say that because of the embarrassing and painful experience that I endured biking to dance one day on megan's mom's bike. I fell like five hundred times that one time. But I took my dad's really nice bike actually to the gas station yesterday to quickly get the tires filled. I then rode my bike the three miles to dance (this was in addition to the couple of miles I ran and the GI Jane situps I did at the park), and preseated in dancing for two hours. I would've bike home, but my mom game and drove me because she said it was too dangerous to do so in the dark by myself.&nbsp;
Then today after it stopped raining, I biked a lot more. I took eight a couple of miles west. I started heading for Haggerty on eight mile, but the sidewalk ends after Newburgh, so I turned around and went back east past the golf course at newburgh and eight. I went south on farmington till five mile, then went east till middlebelt. Then I went the two and a half miles at home.&nbsp;
I think I did it, just to prove to myself I could. Because I felt like a chubbo yesterday after I ate like an entire bag of cheetos. Haha so I just biked for like almost two straight hours. I really started to slow down though towards the end today, because I drake all of my water before I got to Newburgh.&nbsp;

Any way bye.

I'm at O-hoe's right now, for the third night in a row. Only, I'm not spending the night tonight, so therefore, there'll be no drinking. I was wasted Friday, and mildly drunk last night&nbsp; -&nbsp; I look like a heroin addict so I will refrain from it tonight to get a good night's sleep.&nbsp;
My favorite moments of the weekend are by far Gina trying to pee in O-hoe's kitchen last night and Alex falling off the couch on Friday because "He's so hott" haha so many funny moments. When everybody drank it was better, because drinking and getting really wasted by myself like I did, was lame.&nbsp;
Overall, good weekend. End of story.

I just really want to say to everyone who was at Olivia's last night, that I'm sorry for being a fucking idiot. Now I know why Alcoholics Anonymous is anonymous because they're all idiots the morning after.

I don't remember anything past strip spoons. However, I woke up and lots of people who hadn't been there previously were, and it was weird. I don't remember much at all.&nbsp; I know that I lost at strip spoons and I do think my clothes stayed on for the most part. Past that is a complete blank. I guess I was pantsed. Ugh. I woke with a penis on my arm and&nbsp; huge bruise that I don't know where from. I also was wearing Kenny's shirt and I'm not sure why.&nbsp;

I'm really sorry everyone. I'm an idiot and I won't drink at the sequel party tonight, I'll be the person that takes care of all the obnoxious people and no the other way around. I wish I remember what happened, that's only formality that started this summer, which blows. If I at least knew to what degree of an idiot I was, I could have a final verdict in my self deprication right now.&nbsp;

I hate myself for the possibilities of what I did. And that's about it. Again everyone, I'm sorry, beyond belief. I won't be getting drunk tonight, that's for&nbsp;sure.&nbsp;My day yesterday, was unbelievably bad, aside from the amazing lunchin with Sam. That's in addition to all of the drama lately that has had me gritting my teeth. So I just wanted to have a good time, and maybe for a brief period it was worth jugging the five o'clock. But now I'm reminded of why I hate vodka so much and that it isn't wise at all to jug it and then stuff your face with ice cream.

Ah, Katie called me last night at like 9:30pm and i had already fallen asleep. It's now 6am and I'm wide awake. I need to make myself stay up later because this way I'm just bored for longer hours in the day. Hope Putt-putting was fun guys.&nbsp;

RAR, I am mad though, I am going to say this much. Yesterday afternoon my dad and I went to get Burt from Henderson glass because he took him in to get the cracked windshield replaced. Well I was driving Burt and I noticed that my stereo system wasn't on and a piece of it was sitting on the seat next to me. When I was home I showed my dad and I also found some pieces of colored glass in the back seat and a benign wrapper from ice cream that I didn't leave there. If any body ate ice cream, left glass, and broke my radio in my car because we went back to Henderson's to point this out.

In addtion to glass, broken radio, and the wrapper, the car was almost out of gas. I swear that when I left it was a quarter full. My dad remembers there being a decent amount of gas in there too, because if there wasn't he would've filled it up. The guy that physically put the windshield in said that the radio piece was there when he worked on it because he remembered seeing it and not wanting to accidently sit on it. I believe him because Burt sat in the garage for two or three fucking days before it was worked on.&nbsp;Now I have to take the radio to best buy and use the warranty after only one fucking month of having the radio installed. what if in a year it's stolen and the thing expires...fucking henderson glass.

Yeah dress rehearsel was yesterday. I can't say that I like it, but it is necessary, and does get me enthused for this weekend's recitals. For a while yesterday, I thought I was going to get dehydrated...again. When I get dehydrated, it's bad. I hurl, and it's not pretty. Luckily I drank enough water so I was peachy after a while. However, by Martha's intensive, Color Spectrum, I was so exhausted. Then for Silver Fairy, my only pointe dance this year, it felt like I couldn't do anything. Seriously, it's times like those that I wish I had more pointe classes in the year so my performance doesn't blow so much. Finale rehearsel was beyond tedious. We practiced it three times for three different performances, but since precision is the last dance all three recitals, I do the same exact thing. Not that I mind, it's pretty much the same for everyone. There were so many things I forgot to do for rehearsel, I didn't so my ballet shoe elastic or tack down the Silver Fairy tutu. Ah hell, I'll bring saftey pins and call it job well-done.&nbsp;
I'll be honest, I am excited to an extent for recital, and the weird thing is, I don't know why. Haha, maybe mostly for dances like Celebration in Gold and The Blues Brothers. Blues Brothers is fun because our costumes have suspenders and we're wearing hats and sunglasses and I sort of get really into it. haha oh blessed tap.&nbsp;

anyway, recitals tonight
